"use strict";
module.exports = JSON.parse('[{"id":"0","title":"Huawei ICT Roadshow visita Londrina","text":["Nos dias 04 e 05 de dezembro o campus Zona Norte do IFPR Londrina recebeu o Huawei ICT Roadshow, um projeto inovador fruto da parceria entre a Huawei,  renomada multinacional referência em TIC (Tecnologia da Informação e Comunicação), a Unversidade Estadual do Ceará e o Instituto Iracema.","Com o objetivo de apresentar novas tendências de soluções em TIC e seus benefícios, a Huawei equipou um caminhão como escola itinerante, com estações que explicam e ilustram algumas de suas tecnologias emergentes como a Internet das Coisas (IoT), Inteligência Artificial (IA), Cloud Computing, Cibersegurança, Serviços de Storage e Wi-Fi 6.","Além das soluções apresentadas, a carreta ainda ofereceu cursos de capacitação para os estudantes com os temas: Noções básicas de tecnologia de fibra óptica, Introdução à IoT, Inteligência artificial e visão inteligente, Comunicação de dados e redes sem fios, Introdução ao armazenamento de dados e Big Data.","O evento contou com a presença de mais de 200 convidados, entre estudantes, professores e membros da comunidade interna e externa do Instituto. Desde agosto o ICT Roadshow já visitou 20 cidades e treinou 1154 estudantes.","O professor e coordenador da Huawei ICT Academy IFPR, Augusto Luengo Pereira Nunes, destacou: “A presença do ICT Roadshow oferece uma oportunidade única de imersão no ecossistema Huawei para os estudantes, permitindo que observem de perto os efeitos das novas tecnologias na sociedade e na indústria, além de ser uma experiência enriquecedora para o desenvolvimento profissional do aluno, contribuindo para a evolução do cenário de TIC da cidade e região”."],"img":"ICT Roadshow.JPG"},{"id":"1","title":"IFPR campus Londrina recebe Bruno Zitnick, diretor de Relações públicas da Huawei Brasil","text":["09/10/2023 - Os professores Rodolfo Barriviera, chefe do Núcleo de Inovação Tecnológica IFPR Londrina, e Augusto Luengo Pereira Nunes, coordenador da Huawei ICT Academy IFPR Londrina, responsáveis pela parceria com a multinacional  chinesa recebem no Laboratório Avançado de Tecnologia “André Luiz Camargo” do campus, o diretor de Relações Públicas da Huawei Brasil.","Juntamente com o reitor do IFPR, Odacir Antonio Zanatta, a assessora de relações institucionais e de inovação da Fundação Araucária e presidente da governança Londrina Inteligente, Cristiane Cordeiro e Luiz Puppin, diretor do Centro de Treinamentos da FiberX, foram  discutidos temas como o investimento tecnológico na educação, a grande demanda por profissionais qualificados em TIC na região e como solidificar ainda mais a parceria entre a instituição e a Huawei, que possui como visão de negócios, a solução de problemas.","Foram apresentados aos convidados a estrutura do novo laboratório, inaugurado recentemente e que conta com equipamentos de alta tecnologia para os trabalhos do projeto, como a tela interativa IdeaHub da Huawei, utilizada para transmissões online e reuniões.","A parceria entre o IFPR e a Huawei através da criação de uma ICT Academy no campus tem sido importante para o desenvolvimento tecnológico  da região, trazendo visibilidade e oportunidades de qualificação, como os cursos de capacitação em tecnologias 5G e Cloud Services, oferecidos gratuitamente para a comunidade.","Também participaram da reunião Marcelo Estevam, pró-reitor de Extensão, Pesquisa, Pós-Graduação e Inovação do IFPR, Sérgio Assis de Almeida, diretor de Planejamento e Administração do IFPR Londrina e Berenice Tatibana, professora e pesquisadora do IFPR Londrina."],"img":"Visita Huawei (2).JPG"},{"id":"2","title":"Instituto Federal do Paraná (IFPR) disponibiliza curso de 5G","text":["O Instituto Federal do Paraná (IFPR) está empenhado em oferecer aos seus alunos e à comunidade em geral oportunidades de capacitação nas mais avançadas tecnologias de informação e comunicação.","Neste contexto, foram lançados os cursos de Cloud Services e de 5G. Estes cursos já iniciaram suas atividades agora no início de fevereiro.","O curso de 5G, o qual teve 468 inscritos, é fruto da parceria com a Softex, empresa responsável por fomentar a inovação e o empreendedorismo tecnológico no país. O curso conta com materiais da Huawei ICT Academy, programa educacional da Huawei Brasil para suporte à comunidade brasileira, e tem como objetivo formar profissionais capacitados em uma das mais avançadas tecnologias de comunicação móvel. O curso de 5G é uma iniciativa do Ministério da Ciência, Tecnologia e Inovações (MCTI) e Softex no âmbito do Programa MCTI Futuro. Neste curso, assim como no curso de Cloud, os alunos com melhor desempenho receberão vouchers para a realização da prova de certificação em 5G da Huawei (HCIA).","O curso é gratuito e têm duração de 40 horas, com aulas totalmente online. As inscrições ocorreram no início de fevereiro e as aulas iniciaram na primeira semana do mesmo mês","O IFPR se orgulha de oferecer esses cursos em parceria com empresas renomadas, que visam aprimorar a formação de profissionais para atender às demandas do mercado de trabalho em constante evolução. As oportunidades de capacitação em tecnologia trazidas pelos projetos de Cloud e 5G demonstram o comprometimento do IFPR com a formação de uma sociedade mais informada e qualificada, pronta para atuar em um mundo cada vez mais conectado e tecnológico"],"img":"5G.png"},{"id:":"3","title":"Curso de Cloud gratuito oferecido pelo IFPR","text":["O Instituto Federal do Paraná (IFPR) está empenhado em oferecer aos seus alunos e à comunidade em geral oportunidades de capacitação nas mais avançadas tecnologias de informação e comunicação.","Neste contexto, foram lançados os cursos de Cloud Services e de 5G. Estes cursos já iniciaram suas atividades agora no início de fevereiro.","O curso de Cloud conta com a parceria da FiberX e também da Huawei, empresa líder no mercado de tecnologia da informação e comunicação, e tem como objetivo o cultivo de talentos em inteligência artificial e cloud computing. Tendo 454 inscritos, o curso é exclusivo para mulheres e direcionado a todo tipo de público que tenha interesse. As alunas com melhor desempenho no curso receberão vouchers para a realização da prova de certificação em Cloud da Huawei.","O curso é gratuito e têm duração de 40 horas, com aulas totalmente online. As inscrições para o curso de Cloud foram abertas no final de janeiro e as aulas começaram em fevereiro ","O IFPR se orgulha de oferecer esses cursos em parceria com empresas renomadas, que visam aprimorar a formação de profissionais para atender às demandas do mercado de trabalho em constante evolução. As oportunidades de capacitação em tecnologia trazidas pelos projetos de Cloud e 5G demonstram o comprometimento do IFPR com a formação de uma sociedade mais informada e qualificada, pronta para atuar em um mundo cada vez mais conectado e tecnológico"],"img":"cloud.png"},{"id:":"4","title":"Reabertas as inscrições do curso de 5G pelo IFPR","text":["O Instituto Federal do Paraná (IFPR), em parceria com a Softex, anuncia a reabertura das inscrições para o curso de 5G, em parceria com a Softex e com materiais da Huawei ICT Academy. O curso é totalmente gratuito e tem como objetivo capacitar profissionais em uma das mais avançadas tecnologias de comunicação móvel.","Com uma carga horária de 40 horas, o curso é oferecido de forma totalmente online. Os alunos com melhor desempenho receberão vouchers para a realização da prova de certificação em 5G da Huawei (HCIA). As inscrições estarão abertas entre 08/05 e 24/05, com o período das aulas entre 29/05 e 24/06.","Quando as inscrições foram abertas anteriormente, em fevereiro, foram recebidos 468 inscritos. Vários estudantes tiveram a oportunidade de se preparar para a certificação em redes 5G da Huawei. Isto demonstra o empenho do IFPR em oferecer oportunidades de capacitação nas tecnologias mais avançadas de informação e comunicação para seus alunos e para a comunidade em geral. A parceria com empresas renomadas como a Softex e a Huawei ICT Academy decorre do comprometimento do IFPR com a formação de profissionais preparados para atender às demandas deste mercado em constante evolução. O curso de 5G é uma iniciativa do Ministério da Ciência, Tecnologia e Inovações (MCTI) e Softex no âmbito do Programa MCTI Futuro. ","Link para as inscrições: https://lnkd.in/d5TetwqM ","Não perca a chance de se capacitar em uma das mais avançadas tecnologias de comunicação móvel e se destacar no mercado de trabalho. As inscrições foram reabertas e estão disponíveis para o público em geral. Aproveite essa oportunidade única!"],"img":"5g-inscricoes-reabertas.png"}]');

